description:
KMSAuto Net 2015 1.3.7 Multilanguage Portable | 4.28 Mb

KMSAuto Net - automatic KMS-activator for operating systems Windows VL editions: Vista, 7, 8, 8.1, 10, Server 2008, 2008 R2, 2012, 2012 R2 also Office 2010, 2013, 2016.

Additionally, the program activates:
Windows 8.1 Single Language;
Windows 8.1 Core;
Windows 8.1 Core N;
Windows 8.1 Pro WMC;
Windows Embedded 8.1 Industry Pro;
Windows Server 2012 R2 Standard;
Windows Server 2012 R2 Datacenter.
It is based on KMS Server Service from mikmik38 (MDL)
